import '../App.css';

function Profile() {
    return (
        <div className="main-container col-md-12">
                 <h1>you are logged in</h1>
                 <a href="/profile"> <button type="button" class="btn btn-secondary">LOGIN</button></a>

        </div>
    );

}

export default Profile;
